import org.apache.ibatis.annotations.*;

import java.util.List;

/**
 * ProductMapper interface for product CRUD operations using MyBatis annotations.
 */
@Mapper
public interface ProductMapper {

    /**
     * Inserts a new product into the database.
     *
     * @param product the product to insert
     * @return the number of rows affected
     */
    @Insert("INSERT INTO products (name) VALUES (#{name})")
    @Options(useGeneratedKeys = true, keyProperty = "id")
    int insert(Product product);

    /**
     * Updates a product's name based on its ID.
     *
     * @param product the product to update (must have id and name set)
     * @return the number of rows affected
     */
    @Update("UPDATE products SET name = #{name} WHERE id = #{id}")
    int update(Product product);

    /**
     * Deletes products by exact name match.
     *
     * @param name the exact product name to delete
     * @return the number of rows affected
     */
    @Delete("DELETE FROM products WHERE name = #{name}")
    int delete(@Param("name") String name);

    /**
     * Selects products by exact name match (non-fuzzy query).
     *
     * @param name the exact product name to search for
     * @return a list of products matching the exact name
     */
    @Select("SELECT id, name FROM products WHERE name = #{name}")
    List<Product> select(@Param("name") String name);
}

